import React from 'react';

export default class AdminBookView extends React.Component {



    render() {
        return (
            <div>
                <div className="card">
                <div>{this.props.books.name} {this.props.books.author}</div>
                     <button onClick={() => this.props.delete(this.props.book.name)}>Usu≈Ñ</button>
                </div>
                </div>
        )}
}
